import { Nav, ToggleButton } from "react-bootstrap";

const Menu = () => {

    return (
  
                        <button type="button" className="navbar-toggle" data-toggle="collapse" data-target="#clps">
                            <span className="icon-bar"></span>
                            <span className="icon-bar"></span>
                            <span className="icon-bar"></span>
                        </button>
         
        
    )
}

export default ToggleButton;
